import { IconButton, InputAdornment, Stack, TextField } from "@mui/material";

export function Login() {
    return (
        <Stack direction='column' alignItems='center'  height='100vh' width='100%' spacing={2} component='form' paddingTop='24px'>
            <TextField id='username' label='Username' variant='filled' />
            <TextField id='username' label='Password' variant='filled' InputProps={{
                endAdornment: <InputAdornment position="end"><IconButton /></InputAdornment>
            }} />

        </Stack>
    )
}
